- proto: PaperAgrichemManual
  entities:
  - uid: 1225
    mapInit: true
    paused: true
    components:
    - type: Transform
      parent: 1224
    - type: Paper
      content: >-
        Благодарим вас за то, что выбрали руководство NT "АгроХимия это весело" - это весело и безопасно для детей всех возрастов! набор для химии - лучшая обучающая игрушка из серии 2468! Будьте готовы узнать всё о крупнейших инновациях в сельском хозяйстве с тех пор, как люди закапывали рыбу вместе с зернами кукурузы.

         Содержимое:
         5 удобно маркированных бутылок по 30u, по одной с азотом, фосфором, водородом, калием и этанолом.
         2 пробирки Safe-T-Fun(TM) ёмкостью 5u, одна с хлором и одна с радием.
         1 пустая бутылка на 30u, готовая для ваших экспериментов.

        Первый эксперимент: EZ Нутриенты
         Чтобы создать удобрение EZ Нутриенты, богатое питательными веществами и необходимыми для здоровья растений, смешайте равные части азота, фосфора и калия. Чтобы получить полную бутылку, возьмите по 10u каждого реагента.
         Маленькая бутылочка EZ Нутриентов заменяет большую порцию продуктов, которые вы бы в противном случае компостировали, чтобы ваши растения росли сильными. А культуры, которые вы компостируете, не приносят прибыли, поэтому следите за тем, чтобы растения питались только EZ Нутриентами.

         Второй эксперимент: Аммиак и Диэтиламин
         Смешайте водород и азот в пропорции 3к1, чтобы получить аммиак. Это полезное и питательное лакомство для ваших культур, которые находятся не в лучшем состоянии.
         Но если вы хотите произвести впечатление на судей местной ярмарки, спонсируемой компанией NanoTrasen, вам нужно добавить равное количество этанола к аммиаку.
         Эта реакция создаст Диэтилламин, чудодейственное удобрение, которое ускоряет рост растений и продлевает им жизнь! Благодаря Диэтиламину вы сможете дольше выращивать любимые культуры.

         Третий эксперимент: Нестабильный мутаген
         Когда вы будете готовы показать всем, что вы лучший ботаник на станции, вам нужно будет смешать какой-нибудь нестабильный мутаген и надеяться на лучшее. Несмотря на пугающее название, нестабильный мутаген абсолютно безопасен при нанесении на растения, но не пейте это привлекательно зелёное вещество самостоятельно.

         Смешайте равные части радия, фосфора и хлора, чтобы получить ярко-зелёную порцию нестабильного мутагена - безопасный и интересный способ получить максимальную отдачу от своей фермы. 15u, которые вы получите с помощью этого набора, может стать вашим знакомством с агрохимической славой!
         Нестабильный мутаген может оказывать самое разнообразное воздействие на жизнь растений, включая радикальные изменения всевозможных параметров роста, производство полезных фармацевтических препаратов, растений, которые светятся в темноте, или создание совершенно новых видов.

         Каждое растение реагирует на нестабильный мутаген по-разному, поэтому вы можете использовать небольшие дозы для нескольких культур и попытаться получить лучшие результаты от каждой из них. Применение нескольких доз для одного растения может привести к многочисленным изменениям и затруднить выделение желаемых признаков, или вовсе вызвать смерть растения.
         Нестабильный мутаген абсолютно безопасен при использовании в качестве удобрения, и NanoTrasen не несет ответственности за гибель урожая, чрезмерные счета за воду, вновь обретающие сознание растения, задающие экзистенциальные вопросы, или за гибель растений на фермах, которые могут случайно возникнуть при его использовании.
         Не употребляйте нестабильный мутаген. Тщательно мойте руки после употребления. Промойте глаза, если вы смотрели на нестабильный мутаген более 30 минут в течение 24 часов. Храните в тёмном помещении при температуре от 293 до 295 К. Не используйте во время корпоративных праздников. Если вы начнете слышать голоса, советующие вам пить нестабильный мутаген, пожалуйста, обратитесь к своему врачу, руководителю отдела персонала или экзорцисту.
